import React from 'react';
import {Button, Container} from 'react-bootstrap';
import {Routes, Route, useNavigate} from 'react-router-dom';
import './App.css';

let App = () => {
  return (
    <Container fluid>
      <Container className='text-center'>
        <h1 className='header'>DocTalk</h1>
        <Button title="Sign In" variant='info' classname="mt-3" onClick={() =>window.location.href='https://localhost:7000/v1/login'}></Button>
      </Container>
    </Container>
  );
}

export default App;
